import React from "react";

const Image = (props) => {
  return (
    <React.Fragment>
      <div
        className="m-2 md:bg-green-600 bg-orange-600 md:block mx-auto md:mx-2"
        style={{ cursor: "pointer", width: "80vw", height: "53vw" }}
      >
        <img
          src={`img/projectPictures/${props.projectData.imgPath}landing.png`}
          className="h-full"
        />
        <p className="text-center">{props.projectData.name}</p>
      </div>
    </React.Fragment>
  );
};

export default Image;
